      out.write("                        <div class=\"fw mb20\">我从事保险行业 5年 </div>\n");
      out.write("\n");
      out.write("                    <p><br><span style=\"white-space:nowrap;\">个人简介：</span><br></p><p><span style=\"white-space:nowrap;\">2013年毕业于中央财经大学金融专业，毕业后就职于国内知名财富管理机构宜信财富，主要负责高净值客户的开</span></p><p><span style=\"white-space:nowrap;\">发和维护；</span></p><p><span style=\"white-space:nowrap;\">2016年7月正式加入保险行业，专注于为客户提供家庭保障规划、养老规划、税务筹划、资产保全与传</span></p><p><span style=\"white-space:nowrap;\">承规划。</span></p><span style=\"white-space:nowrap;\">如果有一天，我建议您买意外险，不为别的，只为你开车路上有份安心；</span><br><span style=\"white-space:nowrap;\">如果有一天，我建议您买医疗险，不为别的，只为您住院时不用花自己的钱；</span><br><span style=\"white-space:nowrap;\">如果有一天，我建议您买教育险，不为别的，只为孩子能得到更好的教育，确定的未来；</span><br><span style=\"white-space:nowrap;\">如果有一天，我建议您买养老险，不为别的，只为您在夕阳下无忧的笑脸；</span><br><span style=\"white-space:nowrap;\">如果有一天，我建议您买理财险，不为别的，只为您的资产可以合理避税，将爱传承。</span><br><span style=\"white-space:nowrap;\">所获荣誉：</span><br><span style=\"white-space:nowrap;\">2016年10月&nbsp; 入围总公司三季度高峰会</span><br><span style=\"white-space:nowrap;\">2017年2月&nbsp; 荣获本部开门红阶段第三营业部称号</span><br><span style=\"white-space:nowrap;\">2017年4月&nbsp; 入围总公司一季度高峰会</span><br><span style=\"white-space:nowrap;\">2017年7月&nbsp; 入围总公司二季度高峰会</span><br><span style=\"white-space:nowrap;\">2018年1月&nbsp; 荣获2017年全国百强营业部经理称号</span><br><span style=\"white-space:nowrap;\">2018年2月&nbsp; 荣获本部开门红阶段第一营业部称号</span><br><span style=\"white-space:nowrap;\">2018年4月&nbsp; 入围总公司一季度度高峰会</span><br><span style=\"white-space:nowrap;\"><br></span><br><span style=\"white-space:nowrap;\">人生格言：</span><br><span style=\"white-space:nowrap;\">生命不止、奋斗不息</span><br><p></p>\n");
      out.write("                </div>\n");
      out.write("                <div class=\"presentation-wrap\">\n");
